import "./navbar.css";

function NavElements(props){
    const go=()=>{
        window.location.href="/home"
    }
    return(
        <div className="navy">
            <div className="nav-ele offset" onClick={go}>
                <a href={props.link}>{props.nav}</a>
                {/* <p>{props.nav}</p> */}
            </div>
        </div>
    )
}
export default NavElements
